import React from "react";
import "./App.css";

function App() {
  const Blog = () =>
    fetch("https://github-dependents.glitch.me/facebook/react?limit=1")
      .then(response => response.json())
      .then(data => {
        let count = data.totalDependants;
        return count;
      })
      .catch(error => console.error(error));

  return (
    <div className="App">
      {Blog}
      <header className="App-header">
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Used by
        </a>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
